Remove tophub context from VM and Graph Executor because 1. it is no longer up to date and 2. it causes differences in lowering between vm.VMCompiler.optimize and vm.VMCompiler.lower.

Will this cause any impacts? I'm not sure how much tophub is used.

@masahi @comaniac

Numbers were serialized with too little precision when serializing profiling reports to json. Deserialization can then sometimes round the number differently than if the full precision was available.

Fixes #10382.

@driazati
